    /** ÊâìÂºÄÊñá‰ª∂*/
    openfile(args) {
        if (args.type == "true"){
            return new Promise((resolve, reject) => {
                const fileInput = document.createElement('input');
                fileInput.type = 'file';
                fileInput.accept = '';
          
                fileInput.addEventListener('change', () => {
                  const file = fileInput.files[0];
          
                  if (!file) {
                    resolve(''); // ËøîÂõûÁ©∫Â≠óÁ¨¶‰∏≤ÔºåË°®Á§∫Áî®Êà∑Êú™ÈÄâÊã©Êñá‰ª∂
                    return;
                  }
          
                  const reader = new FileReader();
          
                  reader.onload = () => {
                    const fileData = {
                      name: file.name,
                      type: file.type,
                      size: file.size,
                      data: reader.result.split(',')[1],
                    };
          
                    resolve(JSON.stringify(fileData));
                  };
          
                  reader.onerror = () => {
                    reject('error');
                  };
          
                  reader.readAsDataURL(file);
                });
          
                fileInput.addEventListener('cancel', () => {
                  resolve(''); // Áî®Êà∑ÂèñÊ∂àÈÄâÊã©Êñá‰ª∂ÔºåËøîÂõûÁ©∫Â≠óÁ¨¶‰∏≤
                });
          
                fileInput.click();
            });
        }else{
            return new Promise((resolve, reject) => {
                const fileInput = document.createElement('input');
                fileInput.type = 'file';
                fileInput.accept = '';
                fileInput.multiple = true;
          
                fileInput.addEventListener('change', () => {
                  const files = fileInput.files;
                  const fileDataList = [];
          
                  if (files.length === 0) {
                    resolve(JSON.stringify(fileDataList)); // ËøîÂõûÁ©∫Êï∞ÁªÑÔºåË°®Á§∫Áî®Êà∑Êú™ÈÄâÊã©Êñá‰ª∂
                    return;
                  }
          
                  let filesProcessed = 0;
          
                  for (let i = 0; i < files.length; i++) {
                    const file = files[i];
                    const reader = new FileReader();
          
                    reader.onload = () => {
                      const fileData = {
                        name: file.name,
                        type: file.type,
                        size: file.size,
                        data: reader.result.split(',')[1],
                      };
          
                      fileDataList.push(fileData);
          
                      filesProcessed++;
          
                      if (filesProcessed === files.length) {
                        resolve(JSON.stringify(fileDataList));
                      }
                    };
          
                    reader.onerror = () => {
                      reject('error');
                    };
          
                    reader.readAsDataURL(file);
                  }
                });
          
                fileInput.addEventListener('cancel', () => {
                  resolve('[]'); // Áî®Êà∑ÂèñÊ∂àÈÄâÊã©Êñá‰ª∂ÔºåËøîÂõûÁ©∫Êï∞ÁªÑ
                });
          
                fileInput.click();
              });
        }
        
    }

